  // 1 single config is used, the events tables are UNIONed together.\n  // \n  // Config is a simple array of dataset names: e.g.  [ "analytics_1234567", ""analytics_470310189"" ]\n  // Only include extra datasets. Main property will always be included (see /workflow_settings.yaml)\n  EXTRA_GA4_DATASETS_ARRAY: [  ],\n\n  // custom definitions\n  // a very complete list of all recommended and standard event parameters is\n  // included in the `event_params` column.\n  // If you have custom definitions, add them here and they will appear in \n  // the `events_params_custom` column.\n\n  // all custom_ arrays should be in the form:\n  // \n  // { name: "paramname", type: "TYPE", renameTo: "outputcolumnname" }\n  //\n  // "paramname" will be extracted from the data (event param / user property / item custom dim / url parameter)\n  // TYPE will be the column type.\n  // - "int" -> look for int_value, store as INT\n  // - "string" -> look for all values, store as STRING\n  // - "decimal" -> look for all numerical values, store as FLOAT\n  // options:\n  // - "renameTo" -> name the output column to this name. Default: "paramname" will be used\n  // cleaningMethod: lowerSQL -> transform the output (of strings) to lower case\n \n  // event dimensions and metrics\n  // example:\n  // CUSTOM_EVENT_PARAMS_ARRAY: [\n  //    { name: "event_value", type: "decimal" },\n  //    { name: "event_value", type: "string", renameTo: "event_value_string" }\n  // ],\n  CUSTOM_EVENT_PARAMS_ARRAY: [],\n\n  // user properties\n  // example:\n  // CUSTOM_USER_PROPERTIES_ARRAY: [\n  //    { name: "lifetime_value",   type: "decimal" }\n  // ],\n  CUSTOM_USER_PROPERTIES_ARRAY: [],\n\n  // item custom dimensions and metrics\n  // these will appear in `items.item_params_custom.*`\n  // example:\n  // CUSTOM_ITEM_PARAMS_ARRAY: [\n  //    { name: "stock_status", type: "string" }\n  // ]\n  CUSTOM_ITEM_PARAMS_ARRAY: [],\n\n  // URL parameters to extract to own column\n  // (note: all standard utm params are already extracted to `url_params`)\n  // custom url params will appear in `url_params_custom`\n  // (this does NOT support the "type" key: only strings are supported)\n\n  // Examples based on internal search engine params:\n  //   CUSTOM_URL_PARAMS_ARRAY: [\n  //      { name: "q", cleaningMethod: lowerSQL },\n  //      { name: "s", cleaningMethod: lowerSQL },\n  //      { name: "search",cleaningMethod: lowerSQL }\n  //   ],\n  CUSTOM_URL_PARAMS_ARRAY: [],\n\n  // Include session-level custom parameters in the sessions table. These will end up in\n  // int_ga4_sessions and ga4_sessions in the column `session_params_custom`.\n  // \n  // AGGREGATION METHODS (pick):\n  // - first: First value in session (chronologically)\n  // - last: Last value in session (chronologically)\n  // - max: Maximum value in session\n  // - min: Minimum value in session\n  // - boolean: Whether parameter exists with non-null value\n  //\n  // FILTERING OPTIONS:\n  // - eventFilter: Filter by event name(s) - single string or array\n  // - paramFilter: Filter by parameter conditions - supports =, !=, >, >=, <, <=, in, not in, like, not like, is null, is not null\n  // - ignoreNulls: Skip null values (default: true for first/last, always true for max/min/boolean)\n  //\n  // EXAMPLES:\n  // CUSTOM_SESSION_PARAMS_ARRAY: [\n  //   Basic aggregation - no filters\n  //   { name: "event_params_custom.user_id", pick: "first", description: "First user ID" },\n  //   \n  //   Event filtering - single event\n  //   { name: "event_params_custom.page_title", pick: "first", renameTo: "landing_page_title", eventFilter: "page_view", description: "First page title" },\n  //   \n  //   Null handling - respect nulls\n  //   { name: "event_params_custom.lead_id", pick: "first", eventFilter: "page_view", ignoreNulls: false, description: "First lead ID including nulls" },\n  //   \n  //   Single parameter filter - comparison\n  //   { name: "safe_cast(event_params_custom.cart_value as numeric)", pick: "max", eventFilter: "add_to_cart",\n  //     paramFilter: { param: "safe_cast(event_params_custom.cart_value as numeric)", value: 100, operator: ">" },\n  //     description: "Max cart value over $100" },\n  //   \n  //   Multiple conditions - AND logic\n  //   { name: "event_params_custom.product_id", pick: "first", eventFilter: "view_item",\n  //     paramFilter: {\n  //       conditions: [\n  //         { param: "event_params_custom.category", value: ["electronics", "computers"] },\n  //         { param: "event_params_custom.user_country", value: "US" },\n  //         { param: "safe_cast(event_params_custom.price as numeric)", value: 500, operator: ">=" }\n  //       ],\n  //       logic: "and"\n  //     },\n  //     description: "First premium tech product for US users" },\n  // \n  // Note: Column names are automatically sanitized to valid BigQuery identifiers\n  // Warning: Item fields are not (yet) supported!\n  CUSTOM_SESSION_PARAMS_ARRAY: [],\n \n  // provide a list of fields you want to aggregate. These will end up in \n  // int_ga4_sessions and ga4_sessions in the corresponding STRUCT `totals.count/distinct_count/has_event/sum`\n  // examples that show allowed formatting options:\n  // CUSTOM_SESSION_TOTALS: {\n  //   eventsToCount: [\n  //     \'page_view\',\n  //     { name: \'sign_up\', renameTo: \'registrations\'},\n  //     { name: [\'video_start\', \'video_progress\', \'video_complete\'], renameTo: \'video_engagement\' }\n  //   ],\n  //   uniqueFields: [\n  //     { name: \'ecommerce.transaction_id\', renameTo: \'unique_transactions\' },\n  //     { name: \'event_params.currency\', renameTo: \'funnel_currencies\', eventFilter: [\'begin_checkout\', \'purchase\'] },\n  //   ],\n  //   sumFields: [\n  //     \'event_params.video_duration\',\n  //     { name: \'event_params.engagement_time_msec\', renameTo: \'total_engagement_time\' },\n  //     { name: \'ecommerce.purchase_revenue\', eventFilter: \'purchase\', renameTo: \'purchase_revenue\' },\n  //     { name: \'ecommerce.shipping_value\', eventFilter: [\'purchase\', \'refund\'], renameTo: \'net_shipping_value\' },\n  //   ]\n  // },\n  // Warning: item fields are not (yet) supported!\n  CUSTOM_SESSION_TOTALS: {\n    eventsToCount: [],\n    uniqueFields: [],\n    sumFields: [],\n  },\n\n  // Define custom channel groupings added to:\n  // - int_ga4_sessions: session_source.first.{groupingName} and session_source.last.{groupingName}\n  // - ga4_sessions: session_source.{groupingName} and last_non_direct_traffic_source.{groupingName}\n  //\n  // STRUCTURE:\n  // - groupingName: Output column name\n  // - description (optional): Documentation for what this grouping represents (will show up as field description)\n  // - useDefaultChannelGroupingAsFallback (optional): When true, only define channels you want to override.\n  //   All other traffic falls back to default_channel_grouping. When false or omitted, unmatched traffic \n  //   becomes \'(Other)\'. Set to true to avoid redefining all standard channels.\n  // - customColumns (optional): Custom fields to reference in criteria.\n  //   { name: \'device_category\', path: \'device.category\' }\n  // - channelDefinitions: Channel rules (first match wins, order matters)\n  //   { name: \'Channel Name\', criteria: `SQL expression` }\n  //\n  // AVAILABLE DEFAULT FIELDS: source, medium, campaign, category, term, content, campaign_id, default_channel_grouping\n  // CUSTOM COLUMNS: Reference any field from data model (device.*, geo.*, landing_page.*, etc.)\n  // CRITERIA: Standard BigQuery SQL syntax for the grouping logic.\n  // \n  // Example 1: Override specific channels only\n  // {\n  //   groupingName: \'paid_search_split\',\n  //   description: \'Split paid search by search engine, keep all other channels as default\',\n  //   useDefaultChannelGroupingAsFallback: true,\n  //   channelDefinitions: [\n  //     { name: \'Google Paid Search\', criteria: `source = \'google\' and category = \'SOURCE_CATEGORY_SEARCH\' and regexp_contains(medium, r"^(cpc|ppc|paid)$")` },\n  //     { name: \'Bing Paid Search\', criteria: `source = \'bing\' and category = \'SOURCE_CATEGORY_SEARCH\' and regexp_contains(medium, r"^(cpc|ppc|paid)$")` },\n  //     { name: \'Other Paid Search\', criteria: `category = \'SOURCE_CATEGORY_SEARCH\' and regexp_contains(medium, r"^(cpc|ppc|paid)$")` }\n  //     // No catch-all needed - all other traffic uses default_channel_grouping\n  //   ]\n  // },\n  // Example 2: Custom grouping with device and geo data\n  // {\n  //   groupingName: \'device_geo_grouping\',\n  //   description: \'Channel grouping segmented by device type and geography\',\n  //   useDefaultChannelGroupingAsFallback: true,\n  //   customColumns: [\n  //     { name: \'device_category\', path: \'device.category\' },\n  //     { name: \'geo_country\', path: \'geo.country\' }\n  //   ],\n  //   channelDefinitions: [\n  //     { name: \'Mobile Direct\', criteria: `device_category = \'mobile\' and source = \'direct\' and medium = \'(none)\'` },\n  //     { name: \'Desktop Paid Search - US\', criteria: `device_category = \'desktop\' and geo_country = \'United States\' and category = \'SOURCE_CATEGORY_SEARCH\' and regexp_contains(medium, r"^(cpc|ppc|paid)$")` },\n  //     { name: \'Paid Social\', criteria: `(regexp_contains(source, r"^(facebook|instagram|twitter)$") or category = \'SOURCE_CATEGORY_SOCIAL\') and regexp_contains(medium, r"^(cpc|ppc|paid)$")` },\n  //     { name: \'Email\', criteria: `regexp_contains(medium, r"newsletter|mail")` }\n  //   ]\n  // }\n  CUSTOM_CHANNEL_GROUPING: [],\n\n  // filters\n  // array: list the event names you want to exclude from the events table \n  EVENTS_TO_EXCLUDE: [],\n  // arrays: list the hostnames you want to exclude (or include) from the events table\n  // for including/excluding NULL values, use the empty string ( "" )\n  HOSTNAME_EXCLUDE: [],\n  HOSTNAME_INCLUDE_ONLY: [],\n\n  // Set this to true to enable "Organic AI" (and possible other future channels that\n  // are not compatible with GA4)\n  EXTRA_CHANNEL_GROUPS: true,\n\n  // attribution\n  // if a visitors lands on your site without a source, we look back to\n  // find a previous session of this user with a source. How many days?\n  LAST_NON_DIRECT_LOOKBACK_DAYS: 90,\n\n  \n  // USER STITCHING object:\n  // if enabled, we overwrite the user_id column in the ga4_sessions table based on user_pseudo_id\n\n  // you can choose to add more stitching columns in the \'dimensions\' array.\n  // make sure the column names exist in the ga4_events table.\n  // the output column in the sessions table will be a struct "stitched_ids" with these columns in them\n  //\n  // example:\n  //    dimensions: [ \n  //      { name: "user_properties.customer_segment", renameTo: "customer_segment" },\n  //      { name: "event_params.lead_id", renameTo: "lead_id" }\n  //  ],\n  //\n  // lookBackDays: if session is found without a user_id, we look back to\n  // find a previous session of this user with a user_id. How many days?\n  // (default: 90, like the campaign lookback)\n  //\n  // lookAheadDays:  if session is found without a user_id in the past, we look ahead to \n  // find a future session of this user with a user_id. How many days?\n  // Note: this will overwrite "already processed days" to de-anonimise sessions\n  // (default: 0)\n\n  USER_STITCHING: {\n    enabled: false,\n    dimensions: [],\n    lookBackDays: 90,\n    lookAheadDays: 10\n  },\n\n  // Use CUSTOM_EVENT_ID_PARAMETER to add another custom event parameter to the event_id\n  // creation that makes an event unique. We usually recommend using a UNIX timestamp.\n  CUSTOM_EVENT_ID_PARAMETER: \'\',\n\n  // For the ga4_transactions table:\n  // by default, we leave duplicate transaction_ids alone, but you can deduplicate here\n  // note: setting this to true will still keep all transactions with NULL transaction_id\n  TRANSACTIONS_DEDUPE: true,\n  // we keep a running count for transactions, based on an identifier. Defaults to "user_pseudo_id"\n  // if you have an other one, you can change it here (e.g. "user_id" - make sure it\'s a valid column)\n  TRANSACTION_TOTALS_UID: \'user_pseudo_id\',\n\n  // assertions and quality checks can be toggled on (true) or off (false) here\n  // quality checks can be toggled off by changing to false\n\n  // assertions\n  // id uniqueness checks\n  ASSERTIONS_EVENT_ID_UNIQUENESS: false,\n  ASSERTIONS_SESSION_ID_UNIQUENESS: false,\n\n  // check for session durations and events look valid?\n  ASSERTIONS_SESSION_DURATION_VALIDITY: false,\n  ASSERTIONS_SESSIONS_VALIDITY: false, \n  // check GA4 tables: are they on time?\n  ASSERTIONS_TABLES_TIMELINESS: false,\n  // check for a transaction IDs on a purchase?\n  ASSERTIONS_TRANSACTION_ID_COMPLETENESS: false,\n  // check for cookies on all hits? (note: cookieless pings will trigger a fail)\n  ASSERTIONS_USER_PSEUDO_ID_COMPLETENESS: false,\n\n}\n\n\n\nmodule.exports = {\n    customConfig\n};\n'})})]}),"\n",(0,i.jsxs)(s,{id:"ga4-start-date",children:[(0,i.jsx)("summary",{children:"GA4 Start Date"}),(0,i.jsx)(n.pre,{children:(0,i.jsx)(n.code,{className:"language-js",children:'GA4_START_DATE: "2020-01-01"\n'})}),(0,i.jsxs)(n.p,{children:[(0,i.jsx)(n.strong,{children:"Description"}),": Defines the starting date for the GA4 data that the model should process.",(0,i.jsx)(n.br,{}),"\n",(0,i.jsx)(n.strong,{children:"Customization"}),": Change this date to reflect the earliest data you want to include in your reports. For example, if you started collecting GA4 data on a different date, modify this to match that date."]})]}),"\n",(0,i.jsxs)(s,{id:"use-fresh-events",children:[(0,i.jsx)("summary",{children:"Use Fresh Events \ud83d\udc8e"}),(0,i.jsx)(n.pre,{children:(0,i.jsx)(n.code,{className:"language-js",children:"USE_FRESH_EVENTS: true\n"})}),(0,i.jsxs)(n.p,{children:[(0,i.jsx)(n.strong,{children:"Description"}),": If you set this to true, ",(0,i.jsx)(n.code,{children:"ga4_events"})," will query from ",(0,i.jsx)(n.